ControlPropertyState.AutoRuleBindingString:
If(
	IsBlank(dtpBSRSubDTST10.SelectedDate) || IsBlank(dtpPPAPSubDTST10.SelectedDate), 
	Notify("Please fill in all required fields", NotificationType.Error), 
	UpdateContext({existingRecordST10: LookUp(ECN_Stage10, ES010_ECNReference.Value = SelectedECNNo.ES001_ECNReference)} );
	If( 
        !IsBlank(existingRecordST10),
        Patch( ECN_Stage10, existingRecordST10, 
				{
					ES010_ControlPlan: chkControlPlanST10.Value,
					ES010_PFMEA: chkPFMEAST10.Value,
					ES010_WorkInstruction: chkWorkInstructionST10.Value,
					ES010_TrainingNeed: chkTrainingNeedST10.Value,
					ES010_Kaizen: chkKaizenST10.Value,
					ES010_HIPS: chkHIPSST10.Value,
					ES010_JHCheckSheet: chkJHCheckSheetST10.Value,
					ES010_Others: chkOthersST10.Value,
					ES010_PleaseSpecify: txtPleaseSpecifyST10.Text,
					ES010_BSRSubmissionDate: dtpBSRSubDTST10.SelectedDate,
					ES010_PPAPSubmissionDate: dtpPPAPSubDTST10.SelectedDate,					
					ES010_ECNReference: { Value: SelectedECNNo.ES001_ECNReference, Id: LookUp( ECN_Stage1, ES001_ECNReference = SelectedECNNo.ES001_ECNReference).ID},					
                    ES010_ModifyBy: { Value: varUser.User_Name, Id: LookUp(ECN_UserMaster,User_Id = varUser.User_Id).ID}
				}
        ),
        Patch( ECN_Stage10, Defaults(ECN_Stage10),
				{
					Title: SelectedECNNo.ES001_ECNReference, 
					ES010_ControlPlan: chkControlPlanST10.Value,
					ES010_PFMEA: chkPFMEAST10.Value,
					ES010_WorkInstruction: chkWorkInstructionST10.Value,
					ES010_TrainingNeed: chkTrainingNeedST10.Value,
					ES010_Kaizen: chkKaizenST10.Value,
					ES010_HIPS: chkHIPSST10.Value,
					ES010_JHCheckSheet: chkJHCheckSheetST10.Value,
					ES010_Others: chkOthersST10.Value,
					ES010_PleaseSpecify: txtPleaseSpecifyST10.Text,
					ES010_BSRSubmissionDate: dtpBSRSubDTST10.SelectedDate,
					ES010_PPAPSubmissionDate: dtpPPAPSubDTST10.SelectedDate,	
					ES010_ECNReference: { Value: SelectedECNNo.ES001_ECNReference, Id: LookUp( ECN_Stage1, ES001_ECNReference = SelectedECNNo.ES001_ECNReference).ID},
                    ES010_ModifyBy: { Value: varUser.User_Name, Id: LookUp(ECN_UserMaster,User_Id = varUser.User_Id).ID}
				}
			)
    );	
	If(
        !IsEmpty(Errors(ECN_Stage10)), Notify( "An error occurred while saving the record.", NotificationType.Error),
        Patch(
			ECN_Stage1, 
			LookUp(ECN_Stage1,ES001_ECNReference = SelectedECNNo.ES001_ECNReference),
            { ES001_CurrentStage: { Value: "StageClose", Id: LookUp( ECN_StageMaster, Stage_Id = "11").ID }	}
        );
        Notify("Record saved successfully!", NotificationType.Success)
    );    
	Navigate(frmHome)

)
